  sites. Data is typically collected at 1800 second intervals using a MicroCAT Model
  SBE37 (Seabird Electronics, Inc., www.seabird.com). Time series data combining multiple
  deployments from a given site may also be available. Please contact CRED with any
  questions. For program information see the web site https://www.pifsc.noaa.gov/cred/ocean_and_climate_change.php\",\n\t\"owner_org\":
